import React, {useEffect, useState} from 'react';
import './App.css'
import axios from "axios";

function App() {
    const [data, setData] = useState();
    useEffect(()=> {
        const getUser = async() => {
            const response = await axios.get('http://localhost:3100/todos')

            setData(response.data)
        }
        getUser();
    })
    return (
        <div>
            
        </div>
    );
}

export default App;
